import React from 'react';
import './layout.css';
import Sidebar from '../Sidebar/Sidebar';

function Layout(props) {
  return (
    <div
      className='layout'
      style={{
        width: props.width ? props.width : '30%',
      }}
    >
      <Sidebar />

      {props.children}
    </div>
  );
}

export default Layout;
